import React, { Component } from 'react'

export default class Repositories extends Component {



    constructor(props){
        var repositories = localStorage.getItem('@Trinity/repositories')
    }

    state = {
        repos: []
    }

    async FetchRepositories(){
        for (let i = 0; i < repositories; i++) {
            repos[i] = localStorage.getItem(`@Trinity/repo${i}`);

        }
    }

    render() {
        return (
            <div>
                {this.state.repos.map(repositorio=>(
                    <div key={repositorio.id}>
                        <div>{repositorio.name}</div>
                        <div>{repositorio.forks}</div>
                    </div>
                ))}
            </div>
        )
    }
}
